DROP TABLE IF EXISTS `customer`;
create table customer
(
    id          integer not null,
    firstName varchar,
    lastName  varchar,
    birthDate datetime,
    constraint pk_customer_id
        primary key (id)
);

DROP TABLE IF EXISTS `CUSTOMER_BACKUP`;
create table CUSTOMER_BACKUP
(
    id          integer not null,
    firstName varchar,
    lastName  varchar,
    birthDate datetime,
    constraint pk_customers_id
        primary key (id)
);

